import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-headers">
        <p>X/O Game</p>
      </header>
      <body>
        <div className="st table">
          <table>
            <tr>
              <td onclick="placeMarker(0, 0)"></td>
            </tr>
          </table>
        </div>
      </body>
    </div>
  );
}

export default App;
